(6, 'analisa data antaran pos express metode radial basis function neural network rbf nn study pt pos indonesia surabaya', 'pt pos indonesia persero salah perusahaan bergerak bidang komunikasi salah produk pelayanan pt pos indonesia persero produk pos express produk pos express diharapkan diminati masyarakat bertahan keunggulan pt pos indonesia persero analisis pola perkembangan kemajuan memperoleh informasi peramalan waktu produk pos express kantor mail processing center mpc surabaya analisis peramalan produk pos express metode rbf nn radial basic function neural network hasil analisa ujicoba menghasilkan nilai optimal salah satunya percobaan inputan hasil peramalan epoch memperoleh hasil mse mape hasil ramal kunci peramalan jaringan syaraf tiruan jst radial basis function neural network rbf nn'),
(7, 'rancang bangun aplikasi enkripsi sms metode rc berbasis platform android', 'perkembangan teknologi informasi dekade perubahan pesat teknologi informasi penyampaian informasi jarak mudah salah teknologi telekomunikasi menjanjikan kecepatan penyampaian sort message service sms teknologi sms pengguna bertukar pesan cepat mudah tugas dikembangkan aplikasi telepon selular memodifikasi pesan sms cipherteks isi informasi sms pengiriman sms sistem mengenkripsi pesan cipherteks key diinputkan pengirim mengirimkan nomor tujuan penerimaan sms sistem mendekripsi cipherteks plainteks key diinputkan penerima menampilkan pesan asli penerima aplikasi dimanfaatkan mengirimkan informasi rahasia sms takut informasi pesan metode sistem mengenkripsi mendekripsi pesan metode enkripsi rc implementasinya bahasa pemrograman java development kit tools application programing intervace api android sdk kunci sort message service sms enkripsi dekripsi rc android'),
(8, 'sistem pendukung keputusan rehabilitasi bangunan bersejarah metode fuzzy analytical hierarchy process ahp berbasis spasial', 'bangunan bersejarah salah peninggalan cagar budaya kota mengandung cerita jaman perang kemerdekaan dilestarikan nilai kepariwisataan kota surabaya karakteristiknya mengalami penurunan kondisi diindikasikan kerusakan fisik bangunannya mempertahankan kondisi bangunan sesuai umur rencana direncanakan bangunan berdiri kegiatan rehabilitasi pemeliharaan pembangunan berdasarkan tingkat kerusakan bangunan evaluasi analisis multi kriteria sehubungan keterbatasan anggaran prioritas berdasarkan kriteria penanganan bangunan mekanisme perencanaan pembangunan daerah penelitian metode fuzzy analytical hierarchy process fahp dikembangkan thomas saaty prioritas rehabilitasi bangunan ditampilkan mapserver letak bangunannya mengindikasikan rusak rusak berat kunci bangunan bersejarah analisis multi kriteria fuzzy ahp mapserver'),
(9, 'sistem pendukung keputusan penentuan prioritas produk unggulan daerah metode ahp studi kabupaten bangkalan', 'persaingan produk unggulan daerah ketat seiring meningkatnya laju pertumbuhan industri teknologi persaingan mengakibatkan industri jeli merumuskan strategi kebijakan pengambilan keputusan menentukan prioritas produk unggulan daerah sesuai kebutuhan kemampuan keputusan akurat efektif salah memilih meminimalisir kerugian segi biaya waktu penelitian metode fuzzy analytic hierarchy process fahp memiliki kelebihan dimana perkiran skala bersifat tunggal fuzzy ahp mengurangi faktor subyektivitas kriteria sub kriteria metode diharapkan dikembangkan software sistem pendukung keputusan instansi instansi memilih barang alternatif pemilihan nilai bobot perbandingan alternatif kriterianya kriteria omset tenaga target pasar bahan baku badan usaha kunci sistem pendukung keputusan produk unggulan metode fahp'),
(10, 'berhitung mudah jarimatika berbasis multimedia', 'keterampilan berhitung salah ketrampilan dasar dikuasai anak ketrampilan berhitung tua sadar seringkali memaksa anak menguasai berhitung bersemangatnya tua mendorong anak pandai berhitung acap proporsional tua panik anaknya dinilainya terlambat menguasai ketrampilan berhitung tua anak anak sebaya menguasai ketrampilan berhitung kepanikan berkembang kejengkelan kemarahan jarimatika salah operasi hitung latihan berhitung berulang ulang bersamadengan anak anak kuatir anak menguasai ketrampilan jarimatika memiliki kelebihan jarimatika visualisasi proses berhitung anak mudah melakukannya gerakan jari jari tangan menarik minat anak jarimatika relatif memberatkan memori otak alatnya dibeli ketinggalan terlupa dimana menyimpannya hasil uji coba aplikasi penulis kuisioner hasilnya siswa lingkungan sdn mlajah bangkalan kemampuan berhitungnya bertambah bandingkan aplikasi jarimatika'),
(11, 'rancang bangun sistem informasi pemetaan tanaman pertanian kabupaten bangkalan', 'kabupaten bangkalan memiliki lahan pertanian seluas ha luas kabupaten bangkalan lahan sawah teknis seluas ha tegal seluas ha lahan kering mencapai ha tersebar kecamatan topografi datar berbukit pembangunan pertanian mengalami hambatan kesuburan tanah rendah pembangunan pertanian tradisional memerhatikan aspek kesesuaian lahan tanaman tugas dikembangkan sistem informasi pemetaan tanaman pertanian kabupaten bangkalan berbasis lahan penentuan jenis tanaman sistem berpedoman hasil analisa kriteria kesesuaian jenis lahan jenis tanaman metode matching dinas pertanian peternakan balai penyuluhan pertanian bpp kabupaten bangkalan data diperoleh diolah data spasial peta lokasi tanaman memanfaatkan google maps aplikasi pemetaannya aplikasi google maps dipilih memudahkan menentukan lokasi detail penerapan aplikasi sistem informasi membantu pengguna petani perencanaan pemilihan jenis tanaman sesuai dikembangkan kecamatan meningkatkan produktivitas kuantitas kualitas pertanian kabupaten bangkalan kunci kabupaten bangkalan sistem informasi google maps lahan tanaman'),
(12, 'perancangan sistem deteksi plagiarisme karya ilmiah berbahasa indonesia algoritma winnowing fingerprint', 'era teknologi informasi mejadi disalah salah satunya plagiarisme plagiarisme lingkungan akademisi dimana penjiplakan karya tulis ilmiah marak salah mengurangi plagiarisme dengn membangun sistem deteksi plagiarisme algoritma digunanak proses deteksi plagiarisme algoritma winnowing dokumen dibandingkan diproses mendpatkan fingerprint dokumen dimana fingerprint ekumpulan nilai hash fingerprint dokumen dibandingkan kemiripannya kunci penghitungan nilai similarity hasil penghitungan kemiripan dokumen gram menghasilkan similarity mencapai percobaan gram dokumen kemiripan nilai hasil uji coba sistem deteksi plagiarisme algoritma winnowing fingerprint nilai similarity bergantung besarnya nilai gram basis window sistem nilai gram hasil similarity'),
(13, 'rancang bangun aplikasi multimedia pembelajaran teknologi informasi komunikasi tik siswa mts negeri surabaya berbasis ltsa', 'perkembangan teknologi informasi komunikasi tik pengaruh dunia pendidikan proses pembelajaran komunikasi media pendidikan media media komunikasi telepon komputer internet mail dsb interaksi guru siswa hubungan tatap muka media media guru layanan berhadapan siswa siswa memperoleh informasi lingkup luas sumber cyber space ruang maya komputer internet mutakhir berkembangnya disebutcyber teaching pengajaran maya proses pengajaran internet ltsa ieee standar internasional sistem pembelajaran dikembangkan berdasarkan ieee learning standards committee ltsc farance incorporational divisi edutool ltsa arsitektur tingkat tinggi berfokus teknologi pembelajaran pelatihan berbasis komputer sistem pendukung performasi elektronik instruksi berbantuan komputer diartikan kerangka sistem dibangun tugas aplikasi multimedia pembelajaran interaktif dalamnya memuat teknologi informasi komunikasi tik aplikasi dikembangkan php web programming my sql database server'),
(14, 'kalibrasi kamera metode tsai', 'teknik kalibrasi berpengaruh perkembangan computer vision proses teknik kalibrasi pengolahan lanjutan proses vision dilakukannya kalibrasi proses vision mudah prosesnya teknik kalibrasi menentukan parameter proses vision rekonstruksi penelitian mencoba mengangkat teknik kalibrasi kamera klasik popular teknik kalibrasi kamera algoritma tsai simulasi hasil parameter pengukuran tinggi obyek aplikasi dibandingkan tinggi obyek real hasil ujicoba didapatkan hasil tahapan proses kalibrasi kamera metode tsai berhasil data parameter simulasi ujicoba skenario skenario percobaan hasil hasil pengukuran aplikasi hasil pengukuran galat relative perhitungan aplikasi rata rata perhitungan hasil disebabkan proses pengambilan data spesifikasi terbatas kunci kalibrasi kamera algoritma tsai computer vision'),
(15, 'sistem pendukung keputusan penerimaan mahasiswa stkip pgri bangkalan decision tree', 'banyaknya calon mahasiswa mendaftar mahasiswa stkip pgri bangkalan panitia penerima mahasiswa kesulitan menentukan peserta lulus diterima mahasiswa stkip pgri bangkalan keputusan diambil konvensional dirasa efektif penentuan penerimaan mahasiswa dibutuhkan sistem pertimbangan mengambil keputusan penerimaan mahasiswa waktu dibutuhkan penentuan penerimaan mahasiswa efektif hasil maksimal penilaian calon mahasiswa didasarkan kriteria nilai ujian nasional nilai tes stkip pgri bangkalan pendapatan tua dibutuhkan perangkat lunak pendukung keputusan pengambilan keputusan penerimaan mahsiswa mendukung kinerja panitia penerimaan mahasiswa metode pengambilan keputusan algoritma decision tree perangkat lunak dibangun membantu pengambilan keputusan pemecahan multikriteria penerimaan mahasiswa stkip pgri bangkalan bangkalan madura berdasarkan analisa penelitian diperoleh hasil mahasiswa dinyatakan lulus nilai unas mahasiswa dinyatakan lulus perhitungan nilai ujian mahasiswa dinyatakan lulus atribut nilai ujian'),
