(147, 'rancang bangun perangkat lunak pencarian jalur terpendek perjalanan wisata metode algoritma dijkstra studi kota surabaya', 'berwisata menghilangkan kejenuhan rutinitas sehari menambah pengetahuan banyaknya jalan raya terkadang menyulitkan memilih jalan jarak minimum mempengaruhi besarnya biaya dikeluarkan sistem informasi menemukan jalur minimum menghemat waktu memperhitungkan jarak kecepatan berkendara sistem metode algoritma dijkstra berbasis web penggambaran jalur google maps hasilnya akurat tujuan capai berhasil sesuai aplikasi bandingkan jalur biro perjalanan wisata travel mengisi kuesioner pengujian sistem hasil uji coba diambil kesimpulan metode algoritma dijkstra proses pencarian jalur minimum tujuan skenario uji coba ujikan travel rute berbeda travel'),
