(149, 'rancang bangun crm berbasis sms gateway disertai peramalan pergudangan metode fuzzy time series', 'kub rumput laut mitra bahari perusahaan bergerak bidang produksi rumput laut sistem produksi didasarkan inventori stok gudang produksi permintaan penjualan akibatnya permintaan penjualan melebihi stok kub rumput laut mitra bahari memenuhi permintaan permintaan penjualan hasil produksi sisa produk terjual perusahaan memanfaatkan hubungan crm pelanggan perusahaan berbasis sms gateway mempercepat mempermudah hubungan pelanggan perusahaan mengatasi tugas aplikasi crm berbasis sms gateway disertai peramalan pergudangan metode fuzzy time series hubungan crm berbasis sms gateway pelanggan perusahaan mempermudah mempercepat hubungan pelanggan perusahaan perusahaan diharapkan pelanggannya disamping penelitian aplikasi peramalan pergudangan ditindak lanjuti informasi peluang memasok bahan mentah pemasok berbasis sms gateway hasil peramalan perusahaan stok data produksi dibutuhkan periode kunci crm pergudangan fuzzy time series sms gateway'),
(150, 'sistem informasi evaluasi pembelajaran study mts raudlatul mutaallimin babat lamongan', 'perkembangan teknologi pesat dewasa kemudahan manusia melaksanakan tugas kepentingannya salah contohnya sistem informasi membantu menggantikan sistem manual mts raudlatul mutaallimin yayasan pendidikan agama islam proses dokumentasinya sistem manual terintegrasi informasi diakses siswa wali siswa sistem informasi diharapkan kedepannya kemudahan siswa guru nilai raport informasi guru informasi pelajaran informasi kelas informasi jadwal pelajaran media elektronik'),
