(153, 'aplikasi multimedia pengenalan sandi bendera semaphore pramuka berbasis game android', 'visualisasi animasi meberikan informasi interaktif menarik penelitian pemanfaatan teknologi mobile smartphone android pengenalan materi gerakan pramuka gerakan kode bendera semaphore dikemas animasi mobile android penelitian dimanfaatkan adobe air macromedia flash menjalankan aplikasinya platform android aplikasi multimedia pengenalan semaphore flag signaling pramuka berbasis os android kemudahan penggunaan pemahaman materi sandi semaphore step by step pengenalan sandi semaphore berurutan praktek dimana user mengetikkan textbox otomatis animasi bergerak sandi sandi semaphore diketikkan textbox aplikasi dilengkapi fitur tes dimana memahami pengenalan sandi semaphore user disuguhi materi tes gerakan gerakan animasi pemahaman materi disajikan bentuk mobile android aplikasi memudahkan anggota pramuka memahami materi kode bendera semaphore pramuka kunci aplikasi multimedia semaphore flag pramuka os android'),
(154, 'sistem monitoring pemakaian mobil dinas berbasis gps platform android studi pt andalan utama sidoarjo ', 'penggunaan mobil dinas semestinya menyebabkan pembengkakan biaya transportasi penelitian membuktikan perangkat gps android google maps melacak keberadaan perangkat bergerak hasilnya dipengaruhi trafik jaringan selular tinggi trafiknya performa aplikasi menurun berfungsi tugas dikembangkkan aplikasi gps tracking berbasis location based service lbs perangkat gps smartphone android menentukan koordinat disisi client data diperoleh diproyeksikan google maps server dibangun pemrograman android php mysql diperoleh aplikasi memonitoring posisi kendaraan'),
(155, 'sistem informasi evaluasi mutu akademik proses pembelajaran studi program studi teknik informatika universitas trunojoyo madura metode enhanced cumulative voting', 'meningkatkan kualitas pembelajaran universitas trunojoyo madura jurusan teknik informatika evaluasi pembelajaran salah survei peserta survei mahasiswa hasilnya masukan tim penjamin mutu kondisi pengisian survei rekapitulasi hasil penulisan kertas dibuatkan sistem elektronik pengisian rekapitulasi metode cumulative voting metode mudah cepat implementasikan hasilnya diandalkan metode cumulative voting latar obyek berkontribusi mutu akademik mahasiswa pembahasan metode enhanced cumulative voting disingkat ecv dimana metode meningkatkan kualitas hasil cumulative voting mengelompokan obyek mahasiswa kriteria tahun angkatan kehadiran status kuliah diambil waktu pengisian form mahasiswa kelompokan pembobotan metode analytical hierarchy process skala metode ecv hasil evaluasi diharapkan mendekati kenyataan pengelompokan berdasar kriteria kunci ahp cumulative voting weights method of ranking'),
(156, 'sistem informasi evaluasi mutu akademik proses pembelajaran studi program studi teknik informatika universitas trunojoyo madura metode simple additive weight saw', 'universitas trunojoyo madura utm salah perguruan tinggi negeri madura jawa timur instansi sekolah perguruan tinggi terlepas evaluasi pembelajaran terciptanya efektifitas kualitas stake holder stake holder dosen tim jaminan mutu mengambil studi program studi teknik informatika universitas trunojoyo madura ketidakpuasan mahasiswa proses belajar mengajar semester periodenya dituangkan bentuk kuisioner manual bentuk kertas dibuatlah sistem salah metode metode simple additive weight saw tujuan sistem evaluasi proses pembelajarn menghasilkan nilai ipd matakuliah dosen meningkatkan pendidikan proses belajar mengajar efektif hasil pengujian sistem simple additive weight saw mencapai tingkat akurasi data latih user data uji user metode simple additive weight saw evaluasi matakuliah mencapai tingkat akurasi tertinggi');
