(162, 'implementasi algoritma prim depth first search pembuatan maze game berbasis android os mobile', 'teknologi mobile game beroperating system open source berkembang pesat keragaman variasinya mobile game memiliki peminat kalangan dasar pengembang mengembangkan mobile game penelitian mobile game mengasah kemampuan berfikir dikembangkan mengimplementasikan algoritma prim depth first search pembuatannya algoritma prim diterapkan pembuatan lintasan maze algoritma depth first search diterapkan proses pencarian solusinya hasil pengujian disimpulkan algoritma prim depth first search berfungsi resolusi screen pixels pembentukan lintasan pencarian solusi maze kunci mobile game android algoritma prim algoritma depth first search'),
(163, 'sistem pendukung keputusan penilaian kinerja spg metode topsis', 'seiring perkembangan teknologi pesat kebutuhan komputerisasi disegala bidang meningkat terkecuali pengambilan keputusan salah contohnya perusahaan pt haka triputra jaya perkasa perusahaan bergerak dibidang penjualan minuman dikota surabaya penilaian kinerja spg manajemen evaluasi kinerja perusahaan perencanaan tujuan dimasa sesuai peraturan ditentukan perusahaan memperoleh spg kinerjanya butuhkan system pendukung keputusan metode technique for order performance by similarity to ideal solution topsis metode dipilih metode topsis bentuk model pendukung keputusan pengambilan keputusan criteria beragam memecahkan pengambilan keputusan tugas ahkir system pendukung keputusan metode topsis menganalisa criteria menentukan spg layak dipromosikan pengangkatan jabatannya hasil penelitian sistem memiliki tingkat akurat kunci sistem pendukung keputusan penilaian kinerja spg topsis'),
