(259, 'ekstraksi fitur berbasis two dimensional principal component analysis dpca sistem pengenalan wajah feature extraction based on two dimensional principal component analysis dpca for face re', 'pengenalan wajah salah teknologi biometric dikembangkan peneliti dibidang computer vision hasil penelitian dibidang sistem keamanan lingkungan intelijen kepolisian sistem keamanan verifikasi perusahaan perusahaan negara maju riset tugas face recognition citra orl citra buatan dimana citra orl citra kelas pose citra dimensi piksel citra buatan citra kelas pose citra dimensi piksel skenario uji coba sistem skenario database uji coba skenario pose citra training pose citra testing skenario pose citra training pose citra testing proses uji coba sistem membandingkan hasil akurasi penggunaan histogram equalization local binary pattern lbp proses preprocessing membandingkan hasil akurasi penggunaan fitur proses klasifikasinya proses klasifikasi metode canberra distance manhattan distance pendekatan penampilan appearance based hasil uji coba diperoleh membuktikan akurasi tertinggi citra orl skenario histogram equalization hasil terburuk citra orl skenario lbp'),
