(348, 'perancangan pembuatan digital library metode nearest neighbor knn', 'seiring perkembangan teknologi cepatnya aliran data kebutuhan informasi meningkat menyebabkan peningkatan dokumen digital pesat fakta pengguna kesulitan pencarian penemuan dokumen digital menangani salah satunya membangun daftar indeks sistem dibangunya digital library diharapkan membantu meningkatkan penyampaian informasi electronic book memudahkan user pencarian dokumen information retrieval salah memperoleh informasi electronic book penelusuran electronic book tersimpan database proses mengumpulkan informasi halaman web web crawler web crawler berjalan menelusuri halaman web mengumpulkan dokumen dokumen proses download data dikumpulkan web crawler dokumen dokumen diklasifikasikan metode nearest neighbor knn nearest neighbor metode klasifikasi data berdasarkan voting data training data testing klasifikasi didapatkan tingkat akurasi nilai ketetanggaan akurasi nilai berkurang tingkat akurasi proses klasifikasi kunci digital library information retrieval web crawler nearest neighbor'),
