(350, 'rancang bangun mathematics adventure games media pembelajaran pelajaran matematika kelas ii sd', 'media pembelajaran sarana prasarana fasilitas penyampai pesan bahan pelajaran peserta didik efisien efektif memperjelas memperlancar proses belajar game edukasi salah media pembelajaran efektif menyenangkan anak tugas bertujuan mengaplikasikan materi pelajaran matematika kelas ii sekolah dasar game edukasi berjenis adventure diterapkan web browser aplikasi html diimplementasikan salah game engine contruct penelitian diperoleh kesimpulan pengimplementasian materi pelajaran matematika kelas ii sd anak game adventure meningkatkan minat belajar anak hasil kuesioner terbukti mayoritas anak senang belajar bermain game edukasi pembelajaran aplikasi membantu anak memahami pelajaran matematika menjadikan anak menyukai pelajaran matematika'),
