(352, 'media pembelajaran interaktif membaca pendidikan anak usia paud tahap prafonik', 'membaca unsur mendasar dipelajari mudah bidang membaca salah prasyarat memperoleh ilmu pengetahuan membaca diajarkan pendidikan anak usia anak usia mencakup umur tahun tergolong belia dimana anak cenderung senang bermain pendekatan pembelajaran anak usia belia menyerap pelajaran salah pendekatan menarik game pendekatan anak senang bermain bersemangat belajar model pembelajaran diterapkan penelitian metode fonik metode fonik model pembelajaran bahasa indonesia anak usia tahun berdasarkan pendekatan komunikatif tahapan perkembangan anak metode fonik mengajarkan pengenalan huruf menekankan mendengarkan bunyi huruf huruf tahap metode fonik tahap prafonik tahap tahap kelas sd tahap kelas sd penelitian tahap prafonik penelitian diperoleh kesimpulan anak usia berhasil pembelajaran bunyi huruf a benda gambar'),
(353, 'pencarian jarak terpendek pgrouting berbasis webgis pemetaan pendidikan sekolah pls', 'kota sumenep salah kota terletak daerah ujung timur pulau madura memiliki pendidikan sekolah pls meningkatkan kemampuan ilmu diterima pendidikan formal masyarakat sumenep sadar manfaat pls mengikuti programnya letak letak rute terpendek diambil pls mengatasi dibuatlah sistem pencarian jarak terpendek pendidikan sekolah kota sumenep pencarian jarak terpendek dipecahkan memanfaatkan fungsi pgrouting pgrouting pengembangan basis data geospasial postgresql postgis menyediakan fungsi routing perhitungan jarak terpendek berdasarkan bahasa prosedural pg plsql berdasarkan hasil ujicoba metode a tingkat akurasi menentukan rute jarak terpendek hasil ujicoba divisualisasikan leaflet'),
