(518, 'sistem monitoring master plan teknologi informasi pemerintah kota mojokerto', 'perencanaan strategis dibutuhkan evaluasi tolak ukur keberhasilan implementasi master plan teknologi informasi evaluasi survei terkait perkembangannya sistem pengumpulan data evaluasi master plan teknologi informasi skpd struktur perangkat daerah pemerintah kota mojokerto sistem manual survei instansi terkait pengumpulan pencatatan hasil survei data terpisah terkomputerisasi dibutuhkan waktu tenaga memproses data br dikembangkan sistem manajemen data dapatkan survei instansi terkait sistem monitoring survei proses survei monitoring tahun perencanaan master plan teknologi informasi mudah cepat pemerintah memonitor nilai rata rata predikat pengujian usability dihasilkan output sistem data rekap diolah master plan teknologi informasi sasaran br kunci evaluasi sistem master plan teknologi informasi kota mojokerto'),
(519, 'sistem rekomendasi pendukung keputusan pemilihan kepala sekolah algoritma studi dinas pendidikan kabupaten madiun', 'kemajuan sekolah menengah menengah lepas pengaruh kemampuan kepala sekolah mengelola sumber daya sekolah sumber daya manusia berkualitas guru guru memiliki potensi prestasi kepala sekolah mewujudkan pendidikan berkualitas proses seleksi pemilihan kepala sekolah software microsoft excel pengambilan keputusan penentuan calon kepala sekolah dinas pendidikan kabupaten madiun relatif sulit kriteria mempengaruhi pendidikan usia mengajar sertifikat pendidikan wawancara surat sehat tugas bertujuan membangun sistem pendukung keputusan kemampuan analisa pemilihan kepala sekolah algoritma dimana algoritma pohon keputusan memiliki tingkat akurasi tinggi menentukan keputusan penelitian nilai precision algoritma partisi data menghasilkan nilai nilai accuracy algoritma partisi data nilai kunci algoritma pemilihan kepala sekolah sistem pendukung keputusan'),
(520, 'klasterisasi graph jejaring sosial metode medoids', 'berinteraksi menjalin pertemanan jejaring sosial penelitian salah satunya klasterisasi klasterisasi salah teknik data mining kelompok kelompok data kesamaan tinggi data jejaring sosial klasterisasi data twitter data berbentuk graph dikonversi bentuk matriks adjacency diubah bentuk matriks geodesic distance dimensi matriksnya direduksi multidimensional scaling mds diklasterisasi metode medoids metode medoids metode klasterisasi data non hirarki berusaha mempartisi data bentuk cluster klasterisasi graph jejaring sosial metode medoids cluster terbentuk jarak pusat cluster vertex berdekatan dipengaruhi perhitungan cost jarak euclidean distance kualitas klasterisasi metode medoids diukur metode purity hasil penelitian nilai rata rata purity tingkat akurasi penggunaan metode medoids klasterisasi graph twitter cluster mencapai'),
(521, 'sistem pencarian teks terjemahan ayat alquran pembentukan rekomendasi cosine similarity', 'alquran pedoman umat islam menyelesaikan proses pencarian ayat disusun terpisah menimbulkan masyarakat kesulitan memahaminya upaya pencarian digital konsep ir information retrieval pencarian ayat alquran digital mengalami perkembangan memiliki kekurangan segi kecepatan akurasi ketepatan ayat dihasilkan akurasi ketepatan dipengaruhi keyword nilai threshold pembangunan sistem pencarian penelitian menerapkan fasilitas pencarian operasi logika and keyword konsep cache nilai threshold meningkatkan kecepatan akurasi hasil pencarian penelitian metode cosine similarity menghitung kemiripan query ayat database pembentukan rekomendasi diperoleh perbandingan kemiripan ayat mencari keterkaitan ayat berdasarkan hasil pengujian sistem didapatkan nilai minimal cosine similarity rata rata presentase measure tingkat efisiensi kinerja sistem mencapai nilai precision nilai recallnya penggunaan logika and keyword menimbulkan akurasi ketepatan tinggi waktu cepat pembentukan rekomendasi batasan nilai cosine diatas pemrosesan cache membutuhkan waktu relatif stabil dikisaran detik kunci sistem pencarian information retrieval ayat alquran cosine similarity pembentukan rekomendasi');
