(526, 'sistem pendukung keputusan pemberian beasiswa menggunkan metode elimination et choix traduisant la realite ii electre ii', 'beasiswa bantuan keuangan siswa memiliki prestasi akademik beasiswa membantu keberlangsungan pendidikan ditempuh siswa beasiswa memiliki penghargaan siswa penentuan pemberian beasiswa sekolah dituntut kolektif proses pengambilan keputusan pemberian beasiswa harapan penelitian merancang mengaplikasikan mengembangkan sistem pendukung keputusan keputusan pemberian beasiswa calon siswa penerima beasiswa penelitian metode electre ii membantu perhitungan perankingan proses pengambilan keputusan pemberian beasiswa penggunaan sistem pendukung keputusan metode electre ii kriteria alternatif penghasilan tua tangunggan nilai matematika nilai bahasa indonesia nilai bahasa inggris nilai biologi hasil eksperimen metode electre ii uji skenario dihasilkan nilai akurasi data uji data kunci beasiswa sistem pendukung keputusan electre ii'),
