(529, 'implementasi algoritma genetika lindenmayer system pembuatan tanaman cabai game pemeliharaan tanaman', 'game aplikasi media hiburan pembelajaran permainan asset asset bahan dibutuhkan game gambar suara proses pembuatan game asset salah pembuatannya penelitian penulis game pemeliharaan tanaman tanaman game dibentuk sistem membentuk asset gambar tanaman manual pola terbentuk dinamis metode algoritma genetika lindenmayer system kombinasi metode tanaman proporsional game pemeliharaan tanaman unity berjalan platform android penelitian menghasilkan game mengimplementasikan system algoritma genetika menemukan hasil dianggap proporsional merubah persentase prioritas acuan mencari nilai fitness hasilnya tamanan dianggap menempatkan prioritas tertinggi prioritas terendah hasil pengujian evolusi mutasi elitism crossover memperhatikan bracketed menghasilkan bentuk bervariasi'),
