(534, 'aplikasi media pembelajaran matematika dasar interaktif tua anak berbasis mobile android', 'era digital teknologi menunjang pembelajaran perkembangan pembelajaran indonesia matematika dasar ilmu pengetahuan rendah meningkatkannya dibutuhkan media penunjang mendampingi pembelajaran dibutuhkan penelitian merancang aplikasi media pembelajaran mengatasi salah game matematika sederhana dalamnya sadar anak anak mempelajari matematika model kreatif aktif menyenangkan peran tua dibutuhkan proses belajar maksimal dirancang pendekatan sistem mobile android mudah dijangkau elemen masyarakat efektif proses implementasinya data hasil uji coba aplikasi penelitian berjalan device android os gingerbread random access memory minimal mb pengujian kuisioner responden terbiasa android aplikasi membantu meningkatkan kemampuan literasi matematika anak terbiasa android setuju pendapat hasil kuisioner aplikasi efektif pengguna terbiasa device android kunci learning matematika interaktif learning android'),
