(536, 'membangun aplikasi pembelajaran matematika dasar bangun datar bahasa pemrograman python perangkat bergerak', 'abstrak learning sistem berkembang pembelajaran didukung learning learning proses belajar sekolah mobile dukungan learning pembuatan mobile learning bahasa pemrograman python singkat fleksibelnya pembuatan aplikasi apapun python tipe data operasi tingkat tinggi kecepatan pembuatan sistem aplikasi tipe objek hasil penelitian membangun aplikasi pembelajaran matematika dasar bangun datar sekolah dasar tahap utama pengumpulan informasi perencanaan pembuatan uji coba kualitas pembelajaran bangun datar dibangun ditinjau aspek tampilan isi pembelajaran teknologi rentang skor aspek tampilan rata rata aspek isi aspek pembelajaran aspek teknologi penggunaan pembelajaran bangun datar berdampak ketuntasan belajar siswa uji coba kelompok siswa siswa tuntas belajar pembelajaran bangun datar kunci mobile learning android python learning'),
