(575, 'deteksi optic disc citra retina berbasis algoritma differential morphological profile dmp', 'differential morphological profile dmp metode disarankan proses deteksi optic disc od citra fundus retina metode dmp penelitian dmp dilasi metode peningkatan ukuran structure element delta proses dilasi disetiap iterasi citra dihasilkan metode citra tepi daerah diduga optic disc od dibutuhkan tahap daerah od diharapkan tahap gaussian low pass filtering dilasi preprocessing differential morphological profile dilation tepi daerah od dilanjutkan proses perbaikan citra contrast stretching otsu tresholding proses binerisasi tahap ketiga proses penghilangan noise pengambilan region of interest roi keempat menemukan daerah optic disc membentuk lingkaran berdasarkan titik pusat jari jari didapatkan proses penelitian mengggunakan database inspire avr citra retina fundus berwarna citra groundtruth akurasi terbesar penelitian didapatkan iterasi bernilai proses dmp dilasi rata rata sensitivity specificity accuracy terbaik didapatkan menunjukan metode dmp dilasi deteksi optic disc dibandingkan metode morphology kunci differential morphological profile dmp dilasi deteksi optic disc sensitivity specificity accuracy'),
