(675, 'penentuan posisi pemain bertahan sepak bola metode magiq multi attribute global inference quality', 'permainan sepak bola pelatih menentukan posisi pemain permainan data pemain terkadang posisi pemain sesuai kemampuan dimilikinya pelatih kesulitan keputusan menilai pemain obyektif insting menentukan posisi pemain pemain bertahan benteng pertahanan tim kehadiran teknologi sistem pendukung keputusan menentukan posisi pemain bertahan sepak bola pelatih membantu mencapai hasil maksimal pertandingan teknologi penulis tawarkan membangun sistem pendukung keputusan pemilihan posisi pemain bertahan berasal data latihan pemain metode magiq sistem menerapkan metode magiq multi attribute global inference quality pembobotannya mengurutkan prioritas faktor kriteria diproses konsep roc rank order centroid hasil metode magiq yaiitu menghasilkan akurasi hasil rekomendasi sistem rekomendasi pelatih lapangan'),
(676, 'aplikasi tata kelola administrasi desa berbasis hierarchical model view controller hmvc surat menyurat desa', 'pengelolaan administrasi surat menyurat desa manual memperlambat kinerja instansi aplikasi teratasi mempermudah pengembangan surat menyurat administrasi surat menyurat aplikasi konsep hierarchical model view controller penerapan hmvc dipilih memiliki keuntungan pengembangan perangkat lunak mudah perbaikan penambahan pengurangan kode teknik modularisasi aplikasi pengembangan aplikasi administrasi pemerintahan konsep hierarchical model view controller berdasarkan permendagri no tahun berdasarkan hasil uji coba aplikasi pengelolaan administrasi surat menyurat berbasis hmvc pengujian aplikasi kesimpulan pembuatan aplikasi membantu aparat desa proses pelayanan surat menyurat waktu efisien efektif masyaratkat hasil pengujian kuesioner aplikasi tingkat akurasi diperoleh akurat hasil kuisioner memiliki tingkat kepercayaan konsistensi kunci permendagri no tahun administrasi pemerintahan desa hierarchical model view controller hmvc'),
(677, 'pengaruh seleksi fitur performansi model klasifikasi nave bayes diagnosa arrhythmia', 'arrhytmia salah kelainan jantung ditandai ritme jantung normal cepat lambat mendiagnosa arrhytmia prosedur electroardiograf hasil perosedur electrocardiograf electrodiogram kenal ecg ecg dijadikan rujukan mendiagnosa arrhytmia data ecg memiliki ukuran data dibutuhkan proses analisa klasifikasi salah pendekatan memahami data ecg salah algoritma klasifikasi menangani data nave bayes banyaknya fitur dimiliki data ecg hambatan tersendiri proses klasifikasi seleksi fitur mengurangi fitur relevan dataset penelitian memiliki tujuan pengaruh seleksi fitur performansi model klasifikasi naive bayes diagnose arrhytmia hasil penelitian nilai akurasi presisi recall measure mengalami peningkatan menerapkan seleksi fitur dibuktikan nilai akurasi meningkat presisi meningkat nilai recall mengalami kenaikan nilai measure mengalami kenaikan waktu komputasi dibutuhkan detik cepat performa tertinggi didapatkan klasifikasi fitur dihasilkan akurasi presisi recall measure waktu komputasi detik kunci arrhytmia electrocardiogram ecg klasifikasi nave bayes seleksi fitur'),
(678, 'sistem pakar deteksi hama penyakit tanaman jagung metode certainty factor fuzzy sugeno', 'jagung salah hasil tani madura petani madura mengandalkan hujan pengairan jagung tanaman cocok pertanian pulau madura budidaya tanaman jagung membutuhkan pengairan pengairan gagal panen salah faktor mempengaruhi kestabilan panen salah penyebab gagal panen munculnya hama penyakit penanganan cepat dibutuhkan meningkatkan produktifitas tanaman jagung terbatasnya pengetahuan petani sulitnya akses tenaga pakar faktor penangan lambat berdasarkan permasalahan dihadapi sistem pakar mendeteksi hama penyakit tanaman jagung berbasis android tujuannya memudahkan petani tanaman jagung terjangkit hama penyakit mengatasinya sistem pakar deteksi hama penyakit tanaman jagung diimplementasikan metode certainty factor fuzzy sugeno menghasilkan solusi berdasarkan penelitian diperoleh hasil akurasi hasil pengujian berdasarkan kuisioner pengguna rata rata diperoleh nilai kategori setuju kuisioner efektif'),
(679, 'implementasi teknologi virtual reality obyek sarana pengenalan sistem pernapasan manusia', 'virtual reality pemunculan gambar gambar dimensi teks suara bangkitkan komputer persis kedalam bentuk virtual android virtual reality diberbagai bidang salah satunya bidang pendidikan bidang pendidikan teknologi virtual reality media pembelajaran menarik kreatif inovatif tujuan peneelitian mengembangkan aplikasi media pembelajaran sistem pernapasan manusia berbasis virtual reality tujuan pengembangan aplikasi mudah proses belajar mengajar media pembelajaran menggunkan gambar gambar patung organ sistem pernapasan manusia dimiliki sekolahan mts miftahul ulum organ dipatung lengkap mekanisme jenis sistem pernapasan manusia perkenalkan siswa bersifat umum aplikasi memiliki fitur zoom simulasi sistem pernapasan manusia mekanisme pembentukan sistem aplikasi virtual reality media pembelajaran sistem pernapasan manusia sesuai materi proses belajar mengajar diharapkan mts miftahul ulum berdasarkan indikator user experience nilai rata rata'),
(680, 'implementasi seleksi fitur score algoritma diagnosa penyakit diabetes mellitus', 'berdasarkan data organisasi kesehatan dunia who indonesia negara memiliki tingkat kematian keempat tertinggi didunia disebabkan diabetes mellitus diabetes mellitusmerupakan penyakit memiliki gejala wajib diwaspadai banyaknya kehamilan konsentrasi glukosa banyaknya fitur menimbulkan salah satunya proses diagnosa penyeleksian fitur relevan mengurangi proses waktu diagnosa seleksi fitur score mengurangi gejala relevan waktu mendiagnosa efektif akurasi penyeleksian fitur pengklasifikasian penyakit pasien positif diabetes mellitus negatif diabetes mellitus algoritma algoritma machine learning klasifikasi penyakit menemukan pola data tujuan penelitian mengukur nilai akurasi dihasilkan klasifikasi diabetes algoritma seleksi fitur seleksi fitur akurasi metode seleksi fitur score algoritma data training menghasilkan nilai akurasi precision recall waktu'),
(681, 'pendeteksian pengenalan karakter plat nomor kendaraan background substraction area based features extraction', 'meningkatnya kendaraan kendaraan roda kota kota menimbulkan permasalahan lintas terkecuali jalan tol proses transaksi cepat gerbang jalan tol mengurangi antrian kemacetan lintas dibutuhkan aplikasi pengolahan citra pengenalan karakter plat nomor kendaraan penelitian pembuatan aplikasi pengenalan karakter plat nomor citra kendaraan proses deteksi lokasi plat background substraction proses segmentasi karakter proses pengenalan karakter nomor plat area based features extraction data penelitian citra kendaraan memiliki jarak cm cm cm hasil uji coba penelilian tingkat akurasi terbaik skenario jarak cm akurasi deteksi letak plat nomor akurasi segmentasi karakter terbaik akurasi pengenalan karakter'),
(682, 'sistem informasi pemetaan penyebaran penyakit demam berdarah dengue dbd', 'demam berdarah dengue dbd salah penyakit menular bersifat endemik menimbulkan kejadian klb indonesia kabupaten bangkalan tercatat incidence rate ir tahun penduduk case fatality rate cfr angka diatas target nasional provinsi jawa timur ir penduduk cfr dibutuhkan sistem informasi terkait pemetaan penyebaran penyakit demam berdarah dengue membantu proses pemetaan persebaran penyakit demam berdarah dengue dibutuhkan teknologi menerapkan sistem informasi geografis sig metode means clustering sistem membantu instansi kesehatan evaluasi monitoring penyebaran penyakit demam berdarah dengue media informasi mempermudah masyarakat daerah persebaran penyakit demam berdarah dengue berdasarkan hasil pengujian kuesioner rata rata pernyataan diperoleh nilai kategori setuju penerapan metode means clustering efektif dikembangkan penunjang kinerja instansi kesehatan pemetaan penyebaran penyakit demam berdarah dengue kabupaten bangkalan hasil pengujian menentukan cluster metode silhouette coefficient hasil terbaik penggunaan cluster kunci demam berdarah dengue sistem informasi geografis means silhouette coefficient'),
(683, 'aplikasi anatomi tubuh manusia media pengenalan teknologi virtual reality studi ginjal', 'virtual reality vr teknologi simulasi dunia persis bentuk virtual android teknologi virtual reality menampilkan obyek suara teks virtual reality diberbagai bidang salah satunya bidang pendidikan bidang pendidikan teknologi virtual reality media pembelajaran menarik kreatif inovatif teknologi virtual reality vr pembelajaran anatomi tubuh manusia aplikasi fitur zoom simulasi ginjal mekanisme pembentukan urin indikator user experience nilai rata rata indikator mgbl nilai rata rata indikator evaluation heuristic nilai rata rata berdasarkan hasil rata rata indikator disimpulkan aplikasi mudah proses belajar mengajar');
